from typing import List, Dict

def main(input: List[Dict[str, str]]) -> Dict[str, int]:
    hyperdrive_ratings = {}
    for obj in input:
        hyperdrive_rating = obj.get('hyperdrive_rating')
        if hyperdrive_rating:
            hyperdrive_ratings[hyperdrive_rating] = hyperdrive_ratings.get(hyperdrive_rating, 0) + 1
    return hyperdrive_ratings
